const Search = () => {
    return (
        <div className={'search'}>
            <div className="searchForm">
                <input type="text"/>
            </div>
            <div className={'userChat'}>
                <img src="https://www.pexels.com/photo/woman-in-white-long-sleeve-shirt-sitting-on-car-hood-13298639/" alt=""/>
                <div className="userChatInfo"></div>
            </div>
        </div>
    )
}

export default Search;
